INSERT INTO `v1_ab6d366add2a313159d5f0dc8f1bd9a61aeac32ea1dde5c2aa30cdfc13ef6f24` VALUES ("あたしだって\nやるときはやるよ！", 24001, 0.0, 1, 0.0, "2020/04/30 12:00:00", 0.0, 102601, "リン", 1, 0, "2030/12/17 14:59:59", 10040, 24);
INSERT INTO `v1_ab6d366add2a313159d5f0dc8f1bd9a61aeac32ea1dde5c2aa30cdfc13ef6f24` VALUES ("ふぅ…\nこれであたしの仕事は\n終わりだね", 24002, 0.0, 1, 0.0, "2020/04/30 12:00:00", 0.0, 102601, "リン", 1, 1, "2030/12/17 14:59:59", 10040, 24);
INSERT INTO `v1_ab6d366add2a313159d5f0dc8f1bd9a61aeac32ea1dde5c2aa30cdfc13ef6f24` VALUES ("終わった終わった\n一人でもなんとか\nなるもんだね", 24003, 0.0, 1, 0.0, "2020/04/30 12:00:00", 0.0, 102601, "リン", 1, 2, "2030/12/17 14:59:59", 10040, 24);
