INSERT INTO `v1_ab6d366add2a313159d5f0dc8f1bd9a61aeac32ea1dde5c2aa30cdfc13ef6f24` VALUES ("チーズが欲しいなら\nきちんと働いて\n買いに来なよ", 24005, 0.0, 1, 0.0, "2020/04/30 12:00:00", 0.0, 102601, "リン", 1, 4, "2030/12/17 14:59:59", 10040, 24);
